function update( event ) {


if (this.position.z <= 6.369 && this.position.x >= 0.47)
{
	this.position.z += 0.05
	this.rotation.y = 0
} else if (this.position.z > 0 && this.position.x <= -8.5)
{
	this.position.z -= 0.05
	this.rotation.y = 3.14159

}

if (this.position.z >= 6.369 && this.position.x >= -8.5)
{
	this.position.x -= 0.05
		this.rotation.y = -1.5708

} else if (this.position.z <= 0 && this.position.x <= 0.47)
{
	this.position.x += 0.05
	this.rotation.y = 1.5708
}


}
